import Layout from '../components/Layout';
import { useRouter } from 'next/router';
import SingleData from '../components/Single';

const Post = () =>  {

   const router = useRouter(); 

   const { id } = router.query;


   return  (
    <Layout>
        <div>

            <SingleData name={id} />

            <h1></h1>

            <p>This is dynamic page with query strings.</p>
        
        </div>
    </Layout>

    );
};


export default Post;
